js:
var d = [];
let url = "https://rebang.today/";
d.push({
    col_type: "x5_webview_single",
    url: url,
    desc: "float&&100%",
    title: "",
    extra: {
        canBack: true,
        urlInterceptor: $.toString((my) => {
            if (input.startsWith(my)) {
                return false;
            }
            return $.toString((url) => {
                fy_bridge_app.open(JSON.stringify({
                    title: "ËØ¶ÊÉÖ",
                    url: "hiker://empty",
                    findRule: "js:" + $$$.toString((u) => {
                        let js = $.toString(() => {
                            try {
                                if (document.title && document.title.length) {
                                    let r = $$$().lazyRule((t) => {
                                        setPageTitle(t);
                                    }, document.title);
                                    fy_bridge_app.parseLazyRule(r);
                                }
                            } catch (e) {
                                fy_bridge_app.log(e.toString());
                            }
                        });
                        setResult([{
                            url: u,
                            col_type: "x5_webview_single",
                            extra: {
                                canBack: true,
                                js: js
                            },
                            desc: "100%&&float"
                        }]);
                    }, url)
                }))
            }, input)
        }, url)
    }
});

setResult(d);
